import FileInput from "./ui/FileInput";

//css
import { css } from "emotion";

class Profile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      boy: {}
    };
  }

  componentDidMount() {
    this.getBoy(this.props.id);
  }

  getBoy = id => {
    console.log(window.location.href.split("/:", 2));
  };

  render() {
    return (
      <div className={container()}>
        <div>Name</div>
        <div>Age</div>
        <div>Image</div>
        <div>Description</div>
      </div>
    );
  }
}

const container = () => css``;

export default Profile;
